/* 
1. Fetch data from API https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040
2. The result should be like this: https://www.thesportsdb.com/player/34162040
*/




import React from "react";

export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugadores: []
        }

    }


      render() {
    return (
      <div>
        <h1>Player</h1>
        <img src={this.state.jugador.strThumb} />
        <h2>{this.state.jugador.strPlayer}</h2>
        <h3>{this.state.jugador.strPosition}</h3>
        <h4>{this.state.jugador.strDescriptionEN}</h4>
        <h5>{this.state.jugador.strTeam}</h5>
      </div>
    );
  }
}
